    "2016-05-31T01:06:40.187417",nt"name": "afsc-race-sap-jensen-bitter-crab-disease-mortality-in-se-alaska-tanner-crab",nt"isopen":
    false,nt"url": null,nt"notes": "These are data from a laboratory experiment
    in which wild caught male Tanner crab (Chionoecetes bairdi) from Stephens Passage,
    SE Alaska were held to evaluate crab survival while harboring Hematodinium sp.,
    a parasitic dinoflagellate and causative agent of Bitter Crab Syndrome (BCS). In
    October 2014, Tanner crab in various condition states were targeted and collected.
    Targeted crab condition states were visually healthy, visually BCS positive or questionably
    BCS positive. Crab were held from capture until death (ongoing) and crab were tested
    regularly for parasite presence using two methods, blood smears and a PCR assay
    to detect the presence of parasite DNA. The data include crab morphometrics, disease
    status by diagnostic method, and crab survival duration.",nt"license_title":
